*
 * 通知客户端刷新成功与否
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @param {number} params.status - 是否成功 0/1
 *
 * @returns {Promise<*>}
 *
 * @example
 * libSQ.exec('notify-refresh-finish', {
 *   params: {
 *     status: 1,
 *   },
 * }).catch((err) => {
 *   alert(`[refresh][notify-refresh-finish][error] ${JSON.stringify(err, null, 2)}`);
 * });

